import React from 'react'
import '../../Styles/Components/footer.scss'
const Footer = () => {
    return (
        <footer className='footer-container'>
            <p>Desenvolvido por <a href="">Patrick Nazareth</a></p>
        </footer>
    )
}

export default Footer
